import React from 'react';
import { NavLink } from 'react-router-dom';



export class NavbarComponent extends React.Component<any> {
  constructor(props: any){
    super(props);
    this.state ={
        User : []
    }
  }
  render() {
    return (
    <>
      {/* just writing the name of a prop is shorthand for prop={true}*/}
        {/* <NavbarBrand className="sublogo" href="/">Reimbursements</NavbarBrand> */}
        <ul>     
          <li>
            <NavLink to="/hello">Home</NavLink>
          </li>
          <li>
            <NavLink to="/swapi">swapi</NavLink>
          </li>
          { this.props.User && <li><NavLink to="/users">Users</NavLink></li>}
          { this.props.User && <li><NavLink to="/users/1">Single users</NavLink></li>}
          { this.props.User && <li><NavLink to="/reimbursements"> Reimbursements</NavLink></li>}
          <li className="last">&nbsp;</li>
          { !this.props.User && <li><NavLink to="/login">Login</NavLink></li>}          
          { this.props.User && <li><NavLink to="/logout">Logout</NavLink></li>}
        </ul>
    </>
    )
    }
}
